column1:
Build your query using a json.<br/>
For example :<br/>
<pre>
{
    "search": {
        "enabled": [{
            "operator": "=",
            "value": true
        }],
        "sku": [{
            "operator": "STARTS WITH",
            "value": "A"
        }]
    },
    "scope": "ecommerce",
    "locales": "fr_FR,de_DE"
}</pre>

